import React, {Component} from 'react';
// import Nav from 'react-bootstrap/Nav';
import '././css/EachStock.css';
import {Link} from 'react-router-dom';

class NavStock extends Component {
    render(){
        return(
        <div>
            <Nav id = "options" as="ul">
                <Nav.Item as="li">
                    <Link to = '/EachStock'>Quote </Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Link to = '/FutureGrowth'>Future Growth</Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link to = '/Valuation'>Valuation</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link to = '/FinancialHealth'>Financial Health</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link >Company information</Nav.Link>
                </Nav.Item>
            </Nav>

            <nav>
                <ul className="nav-link">
                    <li> Quote </li>
                </ul>
            </nav>


        </div>
        );
    }
}
export default NavStock;
